import React, { Component } from 'react';
import './App.css';

function Hero(){
  return(
    <div className="row">
      <div className="jumbotron col-10 offset-1">
      </div>
    </div>
  )
}

export default class AuthorQuiz extends Component {

  render(){
        return(
            <div className='container-fluid'>
                 <Hero/>
                 <Turn/>
                 <Continue/>
            </div>
        )
  }


}
